import React from 'react'

function Header() {
const headerLink = [
    {blog: "blog", id: 1, url: "/"},
    {About: "About", id: 2, url: "/"},
    {Link: "Links", id: 3, url: "/"},
    {Contact: "Contact", id: 4, url: "/"}
]

  return (
    <div className="justify-between p-3 items-center border-[1px] flex">
      <h1 className=" text-3xl"> Dealiest Blog</h1>
        {headerLink.map((Link) => 
        <ul key={Link.id}>

        </ul>)}
    </div>
  )
}

export default Header
